import React from 'react';

 function Skillbar({ skill, percentage }){
  return (
    <div className="flex items-center space-x-2">
      <div className="relative w-16 h-16">
        <div className="absolute top-0 left-0 rounded-full border-4 border-gray-200 w-full h-full"></div>
        <div className="absolute top-0 left-0 rounded-full border-4 border-green-500 w-full h-full" style={{ clipPath: `inset(${100 - percentage}% 0 0 0 round)` }}></div>
        <div className="absolute top-0 left-0 flex items-center justify-center w-full h-full">
          <span className="text-sm">{percentage}%</span>
        </div>
      </div>
      <span>{skill}</span>
    </div>
  );
};
